                <div className="row rwcercar col-8 offset-2">

                        <input type="date" id="start" name="start" placeholder="Data Inici" className="form-control col-md-5" />
                        <input type="date" id="finish" name="finish" placeholder="Data Fi" className="form-control col-md-5" />
                        <button className="btn btn-primary col-md-2"> Cerca </button>
